import React from "react";
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';

import "./Key.css";
import KeyItem from "./KeyItem";

const Key = () => {
    return (
        <Box className="Key">
            <hr className="TopBorder"/>
            <Grid container className="Items">
                <Grid item xs={12}>
                    <h4>Key</h4>
                </Grid>
                <Grid item xs={5} className="Allergens">
                    <KeyItem value="Favorite" />
                    <KeyItem value="Vegetarian" />
                    <KeyItem value="Gluten free" />
                    <KeyItem value="Nut free" />
                </Grid>
                <Grid item xs={5} className="Allergens">
                    <p>Rare finds</p>
                    <p>Vegan</p>
                    <p>Milk free</p>
                    <p>Allergen free (all 9)</p>
                </Grid>
            </Grid>
        </Box>
    )
}

export default Key;
